import { useState, useEffect } from 'react';
const Fetch = () => {
  const [photos, setPhotos] = useState([]);
  useEffect(() => {
    fetch('https://random-word-api.herokuapp.com/word')
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        console.log(data);
        setPhotos(data);
      });
  }, []);
  return (
    <div>
    <button type= "button" onClick={()=>useEffect()}>Change Word </button>
    </div>
  );
};
export default Fetch;
